import React from 'react'
import EditArticle from './EditArticle'

function Edit() {
  return (
    <div>
        <EditArticle 
            article={this.state.article} 
            handleUpdate={this.handleUpdate}
            id={this.state.article.id}
          />
    </div>
  )
}

export default Edit
